Defendant Patrice L Turner in court with attorney Valeria Lenise Taylor.  Kimberly Dorice Schoepp appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.    

AS TO COUNT 01:
The Court imposed but stayed 9 months at the House of Correction, consecutive, Huber privileges for work, and placed defendant on 18 months probation.

AS TO COUNT 02:
The Court imposed but stayed 6 months at the House of Correction, consecutive to Count 1, Huber privileges for work, and placed defendant on 18 months concurrent probation.

CONDITIONS OF PROBATION:
 - Court ordered defendant to pay $170.00 restitution to Kohls Department Store, plus the costs and disbrusements; plus the DNA surcharges for Counts 1 and 2.  Failure to pay amounts in full would result in a civil judgment entered against defendant.
 - No controlled substances or alcohol;
 - Urine screens;
 - AODA assessment; treatment if needed;
 - Parenting classes;
 - No contact with any Kohls store in the state of Wisconsin;
 - No contact with Tyler G. or any emploee of Kohls;
 - Anger management counseling;
 - Seek and maintain full time employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling.
 - Serve 90 days condition time at the House of Correction, with Huber for work; good time allowed.  Court STAYED report date to:  4/16/15 by 5:00 p.m.

